import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="appWrapper">
      <header className="header">
        <img src="https://86.img.avito.st/208x156/11621659786.jpg"></img>
      </header>
      <nav className="nav">
        <a>Profile</a>
        <a>Messages</a>
        <a>News</a>
        <a>Music</a>
      </nav>
      <div className="content">Main Content</div>
    </div>
  );
}

export default App;
